import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  IconButton,
  Badge,
  Box,
  Menu,
  MenuItem,
  useMediaQuery,
  useTheme,
  Drawer,
  List,
  ListItem,
  ListItemText,
  ListItemIcon,
} from '@mui/material';
import {
  Menu as MenuIcon,
  ShoppingCart as CartIcon,
  Telescope,
  LocalMall,
  Book,
  Home,
  Toys,
  Lightbulb,
  Close as CloseIcon,
} from '@mui/icons-material';

const categories = [
  { name: 'Telescopes', icon: <Telescope />, filter: 'Telescopes & Accessories' },
  { name: 'Merchandise', icon: <LocalMall />, filter: 'Space Merchandise' },
  { name: 'Study Materials', icon: <Book />, filter: 'Books & Education' },
  { name: 'Home Decor', icon: <Home />, filter: 'Home & Lifestyle' },
  { name: 'Space Toys', icon: <Toys />, filter: 'Gadgets & Kits' },
  { name: 'Galaxy Lamps', icon: <Lightbulb />, filter: 'Home & Lifestyle' },
];

const Navbar = () => {
  const navigate = useNavigate();
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('md'));

  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);
  const [anchorEl, setAnchorEl] = useState(null);

  const handleMenuClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  const handleCategoryClick = (filter) => {
    navigate('/products', { state: { category: filter } });
    handleMenuClose();
    setMobileMenuOpen(false);
  };

  const toggleMobileMenu = () => {
    setMobileMenuOpen(!mobileMenuOpen);
  };

  return (
    <AppBar position="fixed" sx={{ background: 'rgba(0,0,0,0.8)', backdropFilter: 'blur(10px)' }}>
      <Toolbar>
        {isMobile ? (
          <>
            <IconButton
              edge="start"
              color="inherit"
              aria-label="menu"
              onClick={toggleMobileMenu}
              sx={{ mr: 2 }}
            >
              <MenuIcon />
            </IconButton>
            <Drawer
              anchor="left"
              open={mobileMenuOpen}
              onClose={toggleMobileMenu}
              PaperProps={{
                sx: {
                  background: 'rgba(0,0,0,0.9)',
                  backdropFilter: 'blur(10px)',
                  width: 250,
                },
              }}
            >
              <Box sx={{ p: 2, display: 'flex', justifyContent: 'flex-end' }}>
                <IconButton onClick={toggleMobileMenu} sx={{ color: 'white' }}>
                  <CloseIcon />
                </IconButton>
              </Box>
              <List>
                <ListItem button onClick={() => { navigate('/'); toggleMobileMenu(); }}>
                  <ListItemText primary="Home" sx={{ color: 'white' }} />
                </ListItem>
                {categories.map((category) => (
                  <ListItem
                    button
                    key={category.name}
                    onClick={() => handleCategoryClick(category.filter)}
                  >
                    <ListItemIcon sx={{ color: '#7c4dff' }}>
                      {category.icon}
                    </ListItemIcon>
                    <ListItemText primary={category.name} sx={{ color: 'white' }} />
                  </ListItem>
                ))}
              </List>
            </Drawer>
          </>
        ) : null}

        <Typography
          variant="h6"
          component="div"
          sx={{
            flexGrow: 1,
            cursor: 'pointer',
            fontWeight: 700,
            background: 'linear-gradient(45deg, #7c4dff, #1a237e)',
            WebkitBackgroundClip: 'text',
            WebkitTextFillColor: 'transparent',
          }}
          onClick={() => navigate('/')}
        >
          COSMOS SHOP
        </Typography>

        {!isMobile && (
          <Box sx={{ display: 'flex', alignItems: 'center', mr: 2 }}>
            <Button
              color="inherit"
              onClick={() => navigate('/')}
              sx={{
                mx: 1,
                '&:hover': { color: '#7c4dff' },
              }}
            >
              Home
            </Button>
            <Button
              color="inherit"
              onClick={handleMenuClick}
              sx={{
                mx: 1,
                '&:hover': { color: '#7c4dff' },
              }}
            >
              Categories
            </Button>
            <Menu
              anchorEl={anchorEl}
              open={Boolean(anchorEl)}
              onClose={handleMenuClose}
              PaperProps={{
                sx: {
                  background: 'rgba(0,0,0,0.9)',
                  backdropFilter: 'blur(10px)',
                  border: '1px solid rgba(255,255,255,0.1)',
                },
              }}
            >
              {categories.map((category) => (
                <MenuItem
                  key={category.name}
                  onClick={() => handleCategoryClick(category.filter)}
                  sx={{
                    color: 'white',
                    '&:hover': {
                      background: 'rgba(124, 77, 255, 0.2)',
                    },
                  }}
                >
                  <ListItemIcon sx={{ color: '#7c4dff' }}>
                    {category.icon}
                  </ListItemIcon>
                  <ListItemText primary={category.name} />
                </MenuItem>
              ))}
            </Menu>
          </Box>
        )}

        <IconButton
          color="inherit"
          onClick={() => navigate('/cart')}
          sx={{
            '&:hover': {
              color: '#7c4dff',
            },
          }}
        >
          <Badge badgeContent={0} color="secondary">
            <CartIcon />
          </Badge>
        </IconButton>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
